"use strict";


describe("mag", function() {
	var TOLERANCE = 1e-14,
	fut;

	beforeEach(function(done) {
		require(["../lib/mag"], function(mag) {
			fut = mag;
			done();
		});
	});

	it("Should support orthoganality", function(){
		expect(fut([0, 0, 0], [1, 1, 1])).toEqual(0);
	});

	it("Should support one dimension", function(){
		expect(fut([0, 0, 1], [1, 1, 1])).toEqual(1);
	});

	it("Should support two dimensions", function(){
		expect(Math.abs(fut([0, 1, 1], [1, 1, 1]) - 1.41421356237310)).toBeLessThan(TOLERANCE);
	});

	it("Should support three dimensions", function() {
		expect(Math.abs(fut([1, 1, 1], [1, 1, 1]) - 1.73205080756888)).toBeLessThan(TOLERANCE);
	});

});

